import growItem from "../growItem.scss" ;
function divider (){
      return<div className="d-flex flex-column col-1   align-items-center " >
      <div style = {{position: "fixed"}} >
      <h2 className="mt-2 mb-4"> <i className="bi bi-house-fill text-success"></i></h2>


<h2 ><i className="bi bi-person-fill text-success ">  </i></h2>


<h2  ><i className="bi bi-chat-text-fill text-success hello "> </i></h2>


<h2  style = {{marginTop : "35px", marginBottom : "35px"}}><i className="bi bi-bar-chart-line-fill text-success "></i></h2>


<h2  style = {{marginTop : "35px", marginBottom : "35px"}}><i className="bi bi-gear-fill text-success "></i></h2>


<h2 className="mt-4 "><i className="bi bi-box-arrow-left text-success "></i></h2>
      </div>
  </div>;
}
export default divider ;
